import { useNavigate } from "react-router-dom";

export default function Dashboard() {
  const navigate = useNavigate();

  return (
    <div className="dashboard">
      <h2>Welcome to Excel Processor</h2>
      <button onClick={() => navigate("/process-file")}>
        Upload & Process File
      </button>
    </div>
  );
}
